const Home = () => {

  const sound = () => {
    const audioCtx = new AudioContext();
    var oscillator = audioCtx.createOscillator();
    oscillator.connect(audioCtx.destination);
  }

  return (
    <>
    <h1>Web Tuner</h1>

    <button onClick={sound}>
      E
    </button>
    <button>
      A
    </button>
    <button>
      D
    </button>
    <button>
      G
    </button>
    </>
  )
};

export default Home;
